    "2013-03-14T15:04:30.778172",nt"name": "national-digital-elevation-dataset-hillshade-1999-raster",nt"isopen":
    false,nt"url": null,nt"notes": "Data available online through GeoStor at
    http://www.geostor.arkansas.gov. The Hillshade (Shaded Relief) dataset is a derived
    product from the USGS National Elevation Dataset. The U.S. Geological Survey has
    developed a National Elevation Database (NED). The NED is a seamless mosaic of best-available
    elevation data. The 7.5-minute elevation data for the conterminous United States
    are the primary initial source data. In addition to the availability of complete
    7.5-minute data, efficient processing methods were developed to filter production
    artifacts in the existing data, convert to the NAD83 datum, edge-match, and fill
    slivers of missing data at quadrangle seams. One of the effects of the NED processing
    steps is a much-improved base of elevation data for calculating slope and hydrologic
    derivatives.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
